import { createContext } from "react";

 const cotizadorContext = createContext()

 const cotizadorProvider = ({children}) => {
     return (
         <cotizadorContext.Provider>
                {children}
         </cotizadorContext.Provider>
     )
 }


 export {
     cotizadorProvider
 }

 export default cotizadorContext
